int main() {
  int N;
  long long K;
  char layout[MAX_N][MAX_N];

  while (1) {
    scanf("%d %lld", &N, &K);
    if (N == 0 && K == 0) {
      break;
    }

    // Generate the layout
    generate_layout(N, K, layout);

    // Check if the layout is valid
    int valid = 1;
    for (int i = 0; i < N; i++) {
      for (int j = 0; j < N; j++) {
        // Check if there is a room with only one adjacent room of the same color
        int count = 0;
        if (i > 0 && layout[i - 1][j] == layout[i][j]) {
          count++;
        }
        if (i < N - 1 && layout[i + 1][j] == layout[i][j]) {
          count++;
        }
        if (j > 0 && layout[i][j - 1] == layout[i][j]) {
          count++;
        }
        if (j < N - 1 && layout[i][j + 1] == layout[i][j]) {
          count++;
        }
        if (count == 1) {
          valid = 0;
          break;
        }
      }
      if (!valid) {
        break;
      }
    }

    // Print the layout or "No"
    if (valid) {
      for (int i = 0; i < N; i++) {
        for (int j = 0; j < N; j++) {
          printf("%c", layout[i][j]);
        }
        printf("\n");
      }
    } else {
      printf("No\n");
    }

    printf("\n");
  }

  return 0;
}
